import logo from './logo.svg';
//import './App.css';
import React, {useEffect, useState} from 'react';
import {getmovie, getpopular} from './Api/api';
import {Search} from './Components/Search';
import {MyProfile, MyList} from "./Components/Myprofile";
import Home from './Components/Homepage';

import Movie from './Api/Movie';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

import image1 from './Home.png';
import image2 from './Search.png';
import image3 from './chat.png';
import image4 from './profile.png';



export default function App() {



   return (

        <Router>
         <div>
           <div className="Bar">
             <nav>
               <Link to="/"> Home </Link>
               <Link to="/MyProfile">   Profile</Link>
               <Link to="/Search"><img className="homepic" src={image2} alt="image1" /></Link>

             </nav>
           </div>
           <Routes>
             <Route path="/" element={<Home/>}/>
             <Route path="/MyProfile" element={<MyProfile />} />
             <Route path="/Search" element={<Search />} />

             <Route path="/mylist" element={<MyList />} />


           </Routes>
         </div>
       </Router>


   );




}



